import React from 'react';
import Map from "mapmyindia-react";
import './App.css';
import {lat1,long1} from './location.js';
var lat,long;


const get= async()=>{
    //lat=lat1;
    //long=long1;
    console.log('lat='+lat+" long="+long);
    const response= await fetch('https://trackmebaby.herokuapp.com/db');
    const data= await response.json();
    lat= await data.results[0].latitude;
    long= await data.results[0].longitude; 
    }



function App() {
  if(get()){
  return (
    <Map
      markers={[
          { 
              position: [ parseFloat(lat) , parseFloat(long)],
              draggable: true, 
              title:"Am here!!",
          }
      ]}
      />
 );
    }


}


export default App;
